textDisplay:
@Андрей Шашерин а, понятно, вы из нерабов. Сейчас, секунду, найду нужную фразу.

Ахаха, лол, вы плохой невоспитанный человек, который мыслит упрощёнными стереотипами и крайностями. И матушка мне ваша не нравится.

Если не затруднит, оцените наш комментарий от 1 до 5 по степени затроллености. Мне для отчётности надо.

@Belena Ещё раз для  альтернативно одарённых, вы неспособны излагать свои мысли на русском литературном языке, излагаясь жаргонизмами, так что ваши умствования здесь неуместны, ясно? ))
Почитайте лучше письмо Белинского - Гоголю.
Ей нужны не проповеди (довольно она слышала их!), не молитвы (довольно она твердила их!), а пробуждение в народе чувства человеческого достоинства, столько веков потерянного в грязи и навозе, права и законы, сообразные не с учением церкви, а со здравым смыслом и справедливостью, и строгое, по возможности, их выполнение. А вместо этого она представляет собою ужасное зрелище страны, где люди торгуют людьми, не имея на это и того оправдания, каким лукаво пользуются американские плантаторы, утверждая, что негр — не человек; страны, где люди сами себя называют не именами, а кличками: Ваньками, Стешками, Васьками, Палашками; страны, где, наконец, нет не только никаких гарантий для личности, чести и собственности, но нет даже и полицейского порядка, а есть только огромные корпорации разных служебных воров и грабителей.

@Podday Parcu Дорогой соотечественник, я уверен на все 120%, что этой осенью мы снесем путинскую власть. 
Полицейские уже ненавидят Путина. Кто его будет защищать? ФСБ? ФСБ первыми сбегут.
Единственное, что меня беспокоит - Путин может застрелиться, а я хочу суда над этой крысой.
